import TileCard from "./TileCard";
import Button from "./Button";
import "./TileArea.css";

function TileArea(props) {
  function getDivHandler(cardFromButton) {
    console.log("TileArea.js produced me");
    props.getToApp(acar);
  }

  return (
    <div>
      <Button name={props.item[0].name} getDiv={getDivHandler} />
      <div className="tile">
        <TileCard
          name={props.item[0].name}
          job={props.item[0].job}
          hobby={props.item[0].hobby}
        />
        <TileCard
          name={props.item[1].name}
          job={props.item[1].job}
          hobby={props.item[1].hobby}
        />
        <TileCard
          name={props.item[2].name}
          job={props.item[2].job}
          hobby={props.item[2].hobby}
        />
        <TileCard
          name={props.item[3].name}
          job={props.item[3].job}
          hobby={props.item[3].hobby}
        />
        <TileCard
          name={props.item[4].name}
          job={props.item[4].job}
          hobby={props.item[4].hobby}
        />
      </div>
    </div>
  );
}

export default TileArea;
